// Get splat after /view
module.exports.handler = async (event, context, callback) => {
  try {
    callback(null, {
        statusCode: 200,
        headers: {
            "Content-Type": "image/png",
        },
        body: "",
        isBase64Encoded: true,
    });
  } catch (e) {
    callback(null, {
        statusCode: 500,
        body: `Something went wrong: ${e}`
    })
  }
};